        e.preventDefault();
        alert('removed' + cardNumber_1.slice(-4))
    }
    function removeCard_2(e) { /* remove credit card 1 */
        e.preventDefault();
        alert('removed' + cardNumber_2.slice(-4));
    }
    function removeCard_3(e) { /* remove credit card 1 */
        e.preventDefault();
        alert('removed' + cardNumber_3.slice(-4));
    }
